import React, { useState } from 'react';
import {Link} from 'react-router-dom'
import {FiArrowLeft} from 'react-icons/fi';

import './styles.css';
import logoImg from '../../assets/logo.png';

export default function NewIncident(){
    const [title, setTitle] = useState('');
    const [description, setDescription] = useState('');
    const [value, setValue] = useState('');

    function handleNewIncident() {

    }

     
    return (
        <div className="new-incident-container">
            <div className="content">
            <section>
            <img src={logoImg} alt="Cadastro Simples"/>

            <h1>Cadastarnovocaso</h1>
            <p>Descreva o caso detalhadamente para enconrar um heroi para resolver isso.</p>
            <Link className="back-link" to  = "/profile"><FiArrowLeft size={16} color="#E02041"/>Voltar para a home </Link> 
            </section>

            <form onSubmit={handleNewIncident}> 
            <input 
                placeholder="Titulo do caso"
                value={title}
                onChange={e => setTitle(e.target.value)}>    
                </input>
            <textarea 
                placeholder="Descrição "
                value={description}
                onChange={e => setDescription(e.target.value)}>
                </textarea>
            <input 
                placeholder="Valor em reais"
                value={value}
                onChange={e => setValue(e.target.value)}>
                </input>
            
            <button className="button" type="submit">Cadastrar</button>

            </form>

            </div>
        </div>
    )
}
